const Page = (props) => {

  const content = props.content || [];

  return (
    <>
      {content.map( (deck,i) => (

        <section className="deck">
           <header><h2>{deck.title}</h2></header>

        <Card />

        </section>

      ))}
    </>
  );
};

export default Page;
